import { Link } from 'react-router-dom';

const InstructorMenu = () => (
  <>
    <Link to="/dashboard/instructor" className="hover:text-purple-600 font-semibold">หน้าหลัก</Link>
    <Link to="/instructor/students" className="hover:text-purple-600">นิสิต</Link>
    <Link to="/instructor/supervisors" className="hover:text-purple-600">อาจารย์นิเทศ</Link>
    <Link to="/instructor/assign" className="hover:text-purple-600">เลือกอาจารย์-นิสิต</Link>
    <Link to="/instructor/scores" className="hover:text-purple-600">ดูคะแนน</Link>
    <Link to="/instructor/profile" className="hover:text-purple-600">โปรไฟล์</Link>
  </>
);

export default InstructorMenu;
